import React from "react";

class NavBar extends React.Component {
	render() {
		return (
<nav className="navbar navbar-expand-lg bg-secondary text-uppercase fixed-top" id="mainNav">
  <div className="container">
    <a className="navbar-brand js-scroll-trigger" href="#page-top">מזג-אוויר ישראל</a>
    <button className="navbar-toggler navbar-toggler-right text-uppercase font-weight-bold bg-primary text-white rounded" type="button" data-toggle="collapse" data-target="#navbarResponsive" aria-controls="navbarResponsive" aria-expanded="false" aria-label="Toggle navigation">
      תפריט
      <i className="fas fa-bars" />
    </button>
    <div className="collapse navbar-collapse" id="navbarResponsive">
      <ul className="navbar-nav ml-auto">
        <li className="nav-item mx-0 mx-lg-1">
          <a className="nav-link py-3 px-0 px-lg-3 rounded js-scroll-trigger" href="#portfolio">ערים נבחרות</a>
        </li>
        <li className="nav-item mx-0 mx-lg-1">
          <a className="nav-link py-3 px-0 px-lg-3 rounded js-scroll-trigger" href="#about">אודות</a>
        </li>
        <li className="nav-item mx-0 mx-lg-1">
          <a className="nav-link py-3 px-0 px-lg-3 rounded js-scroll-trigger" href="map.html">מפת ערי ישראל</a>
        </li>
      </ul>
    </div>
  </div>
</nav>

		);
	}
}

export default NavBar;
